// File: src/components/EditSuccessfulDialog.js

import React from "react";
import "./EditSuccessfulDialog.css"; // Make sure to create a CSS file for styling if needed

const EditSuccessfulDialog = () => {
  return (
    <div className="edit-successful-dialog">
      <p>Password Updated Successfully</p>
    </div>
  );
};

export default EditSuccessfulDialog;
